import React, { useState, useEffect } from 'react';
import logo from './images/bonfire.gif';
import iconImg from './images/icon.png';
import fireImg from './images/fire.png';
import oldFireImg from './images/oldfire.png';
import './App.css';
import "leaflet/dist/leaflet.css"
import {MapContainer, TileLayer, Marker, useMapEvents, Popup } from "react-leaflet";
import { Icon } from 'leaflet';
import {Routes, Route} from "react-router-dom";
import Layout from './components/layout';
import Home from './webpages/home';
import Tracker from './webpages/tracker';
import AboutUs from './webpages/aboutus';


function App() {


  const locIcon = new Icon({
    iconUrl:  iconImg,
    iconSize:[30,30]

  })

  const fireIcon = new Icon({
    iconUrl:  fireImg,
    iconSize:[30,30]

  })

  const oldFireIcon = new Icon({
    iconUrl:  oldFireImg,
    iconSize:[30,30]

  })






  return (

    <div className="App">
      <header className="App-header">
        {/*<img src={logo} className="App-logo" alt="logo" />*/}

          <Layout>
          <Routes>
            <Route path = "/" element = {<Home />} />
            <Route path = "/tracker" element = {<Tracker />} />
            <Route path = "/aboutus" element = {<AboutUs />} />
          </Routes>
          </Layout>
          


      </header>

    </div>
  );
}

export default App;
